import React, {Component} from 'react';


class UserRow extends Component {
    horoscope = () => {
        var h = this.props.data.horoscope;
        if (h === "aries"){
            return '♈';
        }
        else {
            return h;
        }
    }

    render() {
        return <div>
            <p>{this.props.heart()} ID: {this.props.data.userId} | Username: {this.props.data.username} | Horoscope: {this.horoscope()} | Log: {this.props.data.log} </p>
        </div>
    }
}
export default UserRow;
